function get3dTheme2(){
    var theme_3d2 = {
        "icon_description" : "data:image/png;base64,",
        "icon_description_1" : "data:image/png;base64,",
        "icon_settings" : "data:image/png;base64,",
        "icon_settings_1" : "data:image/png;base64,",
        "icon_shortcuts" : "data:image/png;base64,",
        "icon_shortcuts_1" : "data:image/png;base64,",
        "icon_authors" : "data:image/png;base64,",
        "icon_authors_1" : "data:image/png;base64,"
    };

    //console.log('theme_yellow - ' , theme_yellow);
    return theme_3d2;
}

$( document ).ready(function() {
    var theme_3d2 = get3dTheme2();

    //search vindow
    $('.ewq532_fast-search-button.ewq532_fast-search-button1 img').attr('src',theme_3d2['icon_description']);
    $('body').append('<input id="ewq532_fast-search-button_description" changed="0" type="hidden" value="'+theme_3d2["icon_description_1"]+'" />');
    $('.ewq532_fast-search-button.ewq532_fast-search-button2 img').attr('src',theme_3d2['icon_settings']);
    $('body').append('<input id="ewq532_fast-search-button_settings" changed="0" type="hidden" value="'+theme_3d2["icon_settings_1"]+'" />');
    $('.ewq532_fast-search-button.ewq532_fast-search-button3 img').attr('src',theme_3d2['icon_shortcuts']);
    $('body').append('<input id="ewq532_fast-search-button_shortcuts" changed="0" type="hidden" value="'+theme_3d2["icon_shortcuts_1"]+'" />');
    $('.ewq532_fast-search-button.ewq532_fast-search-button4 img').attr('src',theme_3d2['icon_authors']);
    $('body').append('<input id="ewq532_fast-search-button_authors" changed="0" type="hidden" value="'+theme_3d2["icon_authors_1"]+'" />');
    $('.popup2_ewq532_fast-search .container .full_ewq532_fast-search').css('width','365px');
    $('.fast_search_menu_ewq532_fast-search').css('border','5px solid #FF3D22').css('border-radius','0').css('border-bottom-color','#00CBFF').css('border-left-color','#00CBFF').css('background','#FFF');
    $('.big_ewq532_fast-search').css('border','5px solid #FF3D22').css('border-radius','0').css('border-bottom-color','#00CBFF').css('border-left-color','#00CBFF')
        .css('background','#FFF');

});